import styled from "styled-components";
import { IMembershipTier } from "@interfaces";

interface IProps {
    membershipTier: IMembershipTier;
}

export const ComponentCurrentPoint = (props: IProps) => {
    //page props
    const { membershipTier } = props;

    return (
        <StyledCurrentPoint>
            <div className="close"></div>
            <div className="content_currentPoint"></div>
        </StyledCurrentPoint>
    );
};

const StyledCurrentPoint = styled.div`
    height: 100vh;
    width: 100%;
    position: fixed;
    top: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    max-width: 480px;
    background: rgba(0, 0, 0, 0.5);
    .content_currentPoint {
        width: 90%;
        padding: 28px;
        background-color: #fff;
        position: relative;
        border-radius: 8px;
        max-height: 90%;
        overflow: scroll;
    }
    .close {
        position: absolute;
        top: 20px;
        right: 20px;
        cursor: pointer;
    }
`;
